import { LazyPage1, LazyPage2, LazyPage3 } from "../01-lazyload/pages";

interface Route {
  to: string;
  path: string;
  Component: () => JSX.Element;
  name: string;
}

const Lazy1 = React.lazy(() => import("../01-lazyload/pages/LazyPage1"));

export const routes: Route[] = [
  {
    to: "/lazy1",
    path: "lazy1",
    Component: LazyPage1,
    name: "Lazy-1",
  },
  {
    to: "/lazy2",
    path: "lazy2",
    Component: LazyPage2,
    name: "Lazy-2",
  },
  {
    to: "/lazy3",
    path: "lazy3",
    Component: LazyPage3,
    name: "Lazy-3",
  },
];
